description:
Verenigde Staten
Drama
113 minuten

geregisseerd door John Schlesinger
met Jon Voight, Dustin Hoffman en Sylvia Miles

Joe Buck een knappe, naief-charmante cowboy uit Texas, die ervan overtuigd is dat hij de redding is van naar liefde hongerende vrouwen in New York, komt naar de Big Apple om rijkdom te vinden. Echter de enige rijkdom die hij vindt is de vriendschap met Ratzo Rizzo, een verlopen oplichter met grote dromen. In het leven aan de haveloze zelfkant van de maatschappij krijgen deze paria's een onwaarschijnlijke band die verder reikt dan hun verscheurde dromen en hun plannen om snel rijk te worden.



